+		BufferedReader br = null;
+		String text="";	
+		try {
+			fr = new FileReader(f.getAbsolutePath());
+			br = new BufferedReader(fr);
+			String str = "";					
+			while((str=br.readLine())!=null) {
+				text = text + '\n'+ str;
+			}
+		System.out.println(text);	
